import React from 'react';

const Menu = ({ setView }) => {
    return (
        <div className="menu">
            <button onClick={() => setView('recipes')}>My menu</button>
            <button onClick={() => setView('addRecipe')}>Add recipe</button>
            <button onClick={() => setView('schedule')}>Schedule</button>
            <button>Plan</button>
        </div>
    );
}

export default Menu;
